import React from 'react';

export default function RightSidebar({ models, selectedModel, selectedKeyword, onSelectModel }) {
  const filteredModels = selectedKeyword
    ? models.filter((model) => model.keywords.includes(selectedKeyword))
    : models;

  return (
    <div className="sidebar">
      <h3 className="sidebar-title">Frameworks</h3>
      <ul>
        {filteredModels.map((model) => (
          <li
            key={model.id}
            className={`framework-item ${
              selectedModel?.id === model.id ? 'selected-framework' : ''
            }`}
            onClick={() => onSelectModel(model)}
          >
            {model.name}
          </li>
        ))}
      </ul>
    </div>
  );
}
